import React from "react";
import "./layout.css";

function TopNavigation() {
    return (<div className="topNavigation">
        <div className="logo">
            <img src="static/base/MotortestLogoPoziome.png" alt="logo" />
        </div>
    </div>)
}

export default TopNavigation;
